import React from "react";

const GroceryItem = ({
  id,
  product_name,
  stock_available,
  quantity,
  price,
}) => {
  return (
    <div>
      <h2> {product_name} </h2>
      <button>
        {stock_available ? "Stock Available" : "Stock Not Aavilable"}
      </button>
      <h3>{quantity}</h3>
      <p>{price}</p>
    </div>
  );
};

export {GroceryItem}
